        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eThis is the preferred, type-indexed implementation of server-side state.\n\u003c/p\u003e\u003cp\u003eGlossary\n\u003c/p\u003e\u003cp\u003eA persistent entity (PE) is a time-indexed, named global value.\nThe current value of a PE is the value that the PE has now.\nA handle gives access to a snapshot of a persistent entity at a particular time, potentially in the past.\nA handle is \u003cem\u003ecurrent\u003c/em\u003e if the value of the PE has not been \u003ccode\u003eset\u003c/code\u003e or \u003ccode\u003eadd\u003c/code\u003eed to after the creation of the handle.\n\u003c/p\u003e\u003c/div\u003e",
