        "fct-descr": "\u003cp\u003e\u003ccode\u003eadd handle addValue\u003c/code\u003e conceptually, this operation adds \u003ccode\u003eaddValue\u003c/code\u003e to the\n set of values stored in \u003ccode\u003ehandle\u003c/code\u003e. Since this set is represented as a list,\n \u003ccode\u003ehandle\u003c/code\u003e must point to a value of type \u003ccode\u003e[a]\u003c/code\u003e. Since the PE is assumed to\n contain a set, it does not matter if \u003ccode\u003ehandle\u003c/code\u003e is current. However, the\n returned handle is guaranteed to be current with a value that contains\n \u003ccode\u003eaddValue\u003c/code\u003e.\n\u003c/p\u003e",
